Налогоплательщики (за исключением лиц, в случае выставления ими покупателю счета-фактуры с выделением НДС).
Налоговые агенты.
Лица, на которых возложены обязанности налогоплательщиков:
- участники простого товарищества по договорам простого товарищества;
- управляющие товарищи по договорам инвестиционного товарищества;
- концессионеры по концессионным соглашениям;
- доверительные управляющие по договорам доверительного управления имуществом.

Налогоплательщики при импорте товаров на территорию РФ с территории государств-членов таможенного союза по:
- принятым на учет импортируемым товарам;
- по платежу, предусмотренному договором (контрактом) лизинга.
